(function(){let n=document.getElementById("password");if(n!==null){let t=document.getElementById("caps_lock_icon");n.addEventListener("keyup",function(n){n.getModifierState("CapsLock")?t.classList.remove("d-none"):t.classList.add("d-none")});n.addEventListener("blur",function(){t.classList.add("d-none")})}})();